import React from 'react';
import PropTypes from 'prop-types';
import {
  PokemonCard,
  PokemonCardContent,
  PokemonCardFooter,
  PokemonCardMedia,
  PokemonCardBody,
  // ButtonInfo,
  Typographys,
} from './MaterialCardStyle';
import Grid from '@material-ui/core/Grid';

const MaterialCard = ({
    pokemons,
}) => (
    <Grid item xs={3}>
    {/* {
     pokemons.map(pokemon => (
      <PokemonCard key={pokemon.id}>
          <PokemonCardContent>
  
            <PokemonCardMedia />

            <PokemonCardBody>
              <Typographys gutterBottom variant="h5" component="h2">
                {pokemon.pokemon.name}
                {pokemon.pokemon.order}
              </Typographys>
            </PokemonCardBody>
          </PokemonCardContent>
        <PokemonCardFooter />
      </PokemonCard>
     )) 
    } */}
    {
      pokemons.map(pokemon => console.log(pokemon.pokemon))
    }
    </Grid>

);

MaterialCard.propTypes = {
  pokemons: PropTypes.array,
}

export default MaterialCard;
